
# This is a random torch model generated by the following modules: ['MaxPool2d', 'LogSoftmax', 'Conv2d', 'ReLU', 'Linear']
import torch
import torch.nn as nn
import torch.nn.functional as F


class RandomModel(nn.Module):
    def __init__(self) -> None:
        super().__init__()
        self.conv1 = nn.Conv2d(3, 16, kernel_size=3, padding=1)  # Input channel: 3, Output channel: 16
        self.conv2 = nn.Conv2d(16, 32, kernel_size=3, padding=1) # Input channel: 16, Output channel: 32
        self.pool = nn.MaxPool2d(kernel_size=2, stride=2)        # Max pooling layer
        self.fc1 = nn.Linear(32 * 16 * 16, 128)                  # Fully connected layer
        self.fc2 = nn.Linear(128, 10)                             # Second fully connected layer

    def forward(self, x):
        x = self.pool(F.relu(self.conv1(x)))  # Conv -> ReLU -> MaxPool
        x = self.pool(F.relu(self.conv2(x)))  # Conv -> ReLU -> MaxPool
        x = x.view(x.size(0), -1)              # Flatten the output
        x = F.relu(self.fc1(x))                # Fully connected -> ReLU
        x = self.fc2(x)                        # Second fully connected layer
        return F.log_softmax(x, dim=1)        # Log softmax output


def get_random_inputs():
    # randomly generate input tensors based on the model architecture
    x = torch.randn(1, 3, 64, 64)  # Example input: batch size 1, 3 channels, 64x64 image
    return [x]

